import React from "react";
import DirectoresList from "./components/DirectoresList";
import PeliculasList from "./components/PeliculasList";
import AddDirector from "./components/AddDirector";
import AddPelicula from "./components/AddPelicula";

function App() {
    return (
        <div>
            <h1>Gestión de Películas</h1>
            <AddDirector />
            <DirectoresList />
            <AddPelicula />
            <PeliculasList />
        </div>
    );
}

export default App;
